import React, { useEffect } from 'react';
import L from 'leaflet';
import 'leaflet/dist/leaflet.css';

const LandingPage = () => {
  useEffect(() => {
    let sw = L.latLng(1.144, 103.535);
    let ne = L.latLng(1.494, 104.502);
    let bounds = L.latLngBounds(sw, ne);

    let map = L.map('mapdiv', {
      center: L.latLng(1.2868108, 103.8545349),
      zoom: 16,
      maxBounds: bounds,
      maxZoom: 19,
      minZoom: 11
    });

    L.tileLayer('https://www.onemap.gov.sg/maps/tiles/Default/{z}/{x}/{y}.png', {
      detectRetina: true,
      attribution: `<img src="https://www.onemap.gov.sg/web-assets/images/logo/om_logo.png" style="height:20px;width:20px;"/>
                    &nbsp;<a href="https://www.onemap.gov.sg/" target="_blank" rel="noopener noreferrer">OneMap</a>
                    &nbsp;&copy;&nbsp;contributors&nbsp;&#124;&nbsp;
                    <a href="https://www.sla.gov.sg/" target="_blank" rel="noopener noreferrer">Singapore Land Authority</a>`
    }).addTo(map);

    return () => {
      map.remove(); // cleanup on unmount
    };
  }, []);

  return (
    <div>
      {/* Navbar */}
      <nav className="navbar">
        <div className="navbar-container">
          <div className="navbar-logo">
            <img src="/assets/0b020b3c596ade443a0b22760a015f73ecdd10df.png" alt="valuez logo" className="logo-img" />
            <span className="logo-text">valuez</span>
          </div>
          <ul className="navbar-menu">
            <li><a href="#home">Home</a></li>
            <li><a href="#intro">Introduction</a></li>
            <li><a href="#how">See How it Works</a></li>
            <li><a href="#plans">Subscription Plans</a></li>
            <li><a href="#faq">FAQ</a></li>
            <li><a href="#reviews">Reviews</a></li>
          </ul>
          <div className="navbar-actions">
            <a href="#login" className="btn btn-primary">Login / Register</a>
          </div>
        </div>
      </nav>

      {/* Hero Section */}
      <section id="home" className="hero hero-bg" style={{ '--hero-bg': "url('/assets/0a19d89a3f7bfe891b3b4cde9be9a7bccb493ed3.png')" }}>
        <div className="hero-content">
          <h1 className="hero-title">Smarter Property Insights. Backed by Data.</h1>
          <p className="hero-subtitle">Unlock Accurate Property Value â€” Instantly.</p>
          <div className="hero-actions">
            <a href="#login" className="btn btn-primary">Login to get Started</a>
            <a href="#how" className="btn btn-secondary">See How it Works</a>
          </div>
        </div>
      </section>

      {/* Explore Section */}
      <section className="explore" id="intro">
        <h2 className="section-title">Explore Automated Valuations</h2>
        <p className="section-subtitle">Estimate the value of your property now</p>
        {/* ...rest of your JSX structure */}
        <div id="mapdiv" style={{ height: '400px' }}></div>
      </section>

      {/* ...Other sections like How it Works, Items, Testimonials, etc. */}
    </div>
  );
};

export default LandingPage;
